  false,\n\t\"url\": null,\n\t\"notes\": \"Summary of frog observations for abnormal
  conditions at select sites on both Okefenokee and Banks Lake NWRs. During the 2009
  summer, STEP students Zach Carter along with Jessica Bowen surveyed frog abnormality
  at Okefenokee and Banks Lake NWR under the supervision of Wildlife Biologist Sara
  Aicher. It was difficult to find a good spot to sample due to fluctuating water
  levels. We tried to find spots that were not too deep nor to shallow. With it being
  in the middle of the summer, a lot of the standing water around could easily dry
  up without sufficient rainfall. We started to look for more permanent locations
  around the swamp. This year we had four sample sites at Okefenokee NWR and two sites
  at Banks Lake NWR. Below is a summery of the data. No abnormalities were observed
  at the sample sites.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
